.pl-05 {
  padding-left: 0.5rem !important;
}

.mb-0 {
  margin-bottom: 0 !important;
}

.mw-historical-control-select {
  padding: 0.5rem;
  label {
    margin: 0;
    padding: 5px 10px 5px 9px;
    display: inline-block;
  }
  select {
    padding: .2rem .5rem;
    width: auto;
    height: auto;
    display: inline-block;
    font-size: 11.5px;
    border-radius: 0;
  }
}
.mw-sdk-styled {
  &.cbpo-dashboard {
    border: none;
  }
  /deep/ {
    .cbpo-dashboard-container{
      border: none;
      padding: 0
    }
    .cbpo-wrapper-action{
      margin-left: auto;
    }
    .cbpo-btn {
      display: flex;
      justify-content: center;
    }
    .cbpo-btn .spinner-border {
      width: 10px;
      height: 10px;
      border-width: 1px;
    }
  }
}
